import React from 'react';
import Logo from './Logo';
import '../styles/Navbar.css';
import { Link } from 'react-router-dom';
const Navbar = () => {
    return (
        <div className="navContainer">
            <Logo />
            <ul className="navbarMenu">

                <li>
                    Profile
                </li>
                <Link to="/">
                <li>
                    Logout
                </li>
                </Link>
            </ul>
        </div>
    );
};

export default Navbar;
